import { Box, Stack, Typography } from "@mui/material";
import PollCard from "../components/PollCard";

export interface PollInfo {
  title: string;
  description: string;
}

interface ActivePollsPageProps {
  pollPageType: PollPageType;
  polls: PollInfo[];
  pollCardButtonText: string;
  pollCardHandler: () => void;
}

const ActivePollsPage = (props: ActivePollsPageProps): JSX.Element => {
  return (
    <Box marginTop="2%">
      <Typography variant="h2">Ongoing polls</Typography>
      <Stack
        direction="row"
        marginTop="4em"
        columnGap="4em"
        rowGap="4em"
        display="flex"
        flexWrap="wrap"
      >
        <PollCard
          cardTitle="Card Title"
          cardDescription="Card Description Description Description Description Description Description Description Description Description"
        />
        <PollCard cardTitle="Card Title" cardDescription="Card Description" />
        <PollCard cardTitle="Card Title" cardDescription="Card Description" />
        <PollCard cardTitle="Card Title" cardDescription="Card Description" />
      </Stack>
    </Box>
  );
};

export default ActivePollsPage;
